import React from 'react';

const SimpleMap = () => {
  return (
    <div style={{ width: '35%', height: '', margin: '2rem auto' }}>
      <iframe
        title="Google Map"
        src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d14678.337950268015!2d-51.4783959!3d-25.3593769!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x94e2231211111111%3A0x0a6b93c7ff8bcd1f!2sAloha%20Turismo!5e0!3m2!1spt-BR!2sbr!4v1698055030587!5m2!1spt-BR!2sbr"
        width="100%"
        height="400"
        style={{ border: 0 }}
        allowFullScreen
        loading="lazy"
      ></iframe>
    </div>
  );
};

export default SimpleMap;
